func Test_bestRotation(t *testing.T) {
	ast := assert.New(t)

	for _, tc := range tcs {
		fmt.Printf("~~%v~~\n", tc)
		ast.Equal(tc.ans, bestRotation(tc.A), ":%v", tc)
	}
}

func Benchmark_bestRotation(b *testing.B) {
	for i := 0; i < b.N; i++ {
		for _, tc := range tcs {
			bestRotation(tc.A)
		}
	}
}
